const CampaignDetails = () => {

  const { campaignId } = useParams();

  const selectedCampaign = JSON.parse(localStorage.getItem('selectedCampaign'));

  // Проверьте, что выбранная кампания существует
  if (!selectedCampaign) {
    return <div>Данные для выбранной кампании не найдены.</div>;
  }


  return (

    <div>
      <h2>{selectedCampaign.campaign_title}</h2>
      {/* Отобразите остальные данные о кампании */}
    </div>

  );
};

export default CampaignDetails;
